import React from 'react';

function Projects() {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <div>
        <h3>Project 1</h3>
        <p>Description of Project 1.</p>
      </div>
      <div>
        <h3>Project 2</h3>
        <p>Description of Project 2.</p>
      </div>
      {/* Add more projects as needed */}
    </section>
  );
}

export default Projects;
